import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPage = () => {
  const [category, setCategory] = useState('');
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedBird, setSelectedBird] = useState(null);
  const [editModalVisible, setEditModalVisible] = useState(false);
  const [formFields, setFormFields] = useState({
    name: '',
    image: '',
    origin: ''
  });

  useEffect(() => {
    if (!category) return;
    setLoading(true);
    axios.get(`http://localhost:5555/api/${category}`)
      .then(response => {
        const normalizedData = response.data.map(item => ({
          id: item._id,
          name: item.name,
          image: item.image,
          origin: item.place_of_found || item.origin
        }));
        setData(normalizedData);
        setLoading(false);
      })
      .catch(error => {
        setLoading(false);
      });
  }, [category]);

  const handleCategoryChange = event => {
    setCategory(event.target.value);
  };

  const handleEdit = item => {
    setSelectedBird(item);
    setFormFields({ name: item.name, image: item.image, origin: item.origin });
    setEditModalVisible(true);
  };

  const handleUpdate = () => {
    axios.put(`http://localhost:5555/api/${category}/${selectedBird.id}`, formFields)
      .then(response => {
        setEditModalVisible(false);
      })
      .catch(error => {
      });
  };

  const handleInputChange = (event) => {
    setFormFields({
      ...formFields,
      [event.target.name]: event.target.value
    });
  };

  const renderTable = () => {
    if (loading) {
      return <p>Loading...</p>;
    }

    if (!data.length) {
      return <p>No data available.</p>;
    }

    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Photo</th>
            <th>Origin</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {data.map(item => (
            <tr key={item._id}>
              <td>{item.name}</td>
              <td><img src={item.image} alt={item.name} height="100px" /></td>
              <td>{item.origin}</td>
              <td>
                <button onClick={() => handleEdit(item)}>Edit</button>
                <button onClick={() => handleUpdate()}>Update</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  return (
    <div>
      <h1>Admin Page</h1>
      <div>
        <label htmlFor="category">Select Category:</label>
        <select id="category" value={category} onChange={handleCategoryChange}>
          <option value="">Select...</option>
          <option value="birds">Birds</option>
          <option value="cats">Cats</option>
          <option value="dogs">Dogs</option>
        </select>
      </div>
      {renderTable()}
      {editModalVisible && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setEditModalVisible(false)}>Ã—</span>
            <h2>Edit Bird</h2>
            <form>
              <label>Name:</label>
              <input type="text" name="name" value={formFields.name} onChange={handleInputChange} />
              <label>Image URL:</label>
              <input type="text" name="image" value={formFields.image} onChange={handleInputChange} />
              <label>Origin:</label>
              <input type="text" name="origin" value={formFields.origin} onChange={handleInputChange} />
              <button type="button" onClick={handleUpdate}>Save Changes</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminPage;
